import { Outlet } from "react-router-dom";
import { hpe } from 'grommet-theme-hpe';
import {Grommet} from 'grommet';
import HeaderNavigationExample from '../components/Header/Header';

const Layout = () => {


  return (
    <>
      <Grommet theme={hpe}>
        <HeaderNavigationExample />

        <Outlet />
      </Grommet>
    </>
  )
};

export default Layout;
